import React from "react";
import { BsInstagram, BsPinterest, BsTiktok, BsTwitter } from 'react-icons/bs';

const Footer : React.FC = () => {
    return(
        <>
            <p className="font-marker">sketchsauce</p>
            <BsTiktok />
            <BsInstagram />
            <BsTwitter />
            <BsPinterest />
        </>
    );
}

export default Footer;
